function Movie() {
  return (
    <div>
      {movies.map((movie, index) => (
        <div key={movie.id}>
          <h2>{movie.title_long}</h2>
          <img src={movie.medium_cover_image}></img>
          <ul>
            {movie.genres.map((genre) => (
              <li key={genre}>{genre}&nbsp;</li>
            ))}
          </ul>
          <p>{movie.summary}</p>
        </div>
      ))}
    </div>
  );
}
export default Movie;
